from pytoniq_core import Slice


def load_wallet_v1_data(cell_slice: Slice) -> bytes:
    cell_slice.load_uint(32)
    return cell_slice.load_bytes(32)


def load_wallet_v2_data(cell_slice: Slice) -> bytes:
    cell_slice.load_uint(32)
    return cell_slice.load_bytes(32)


def load_wallet_v3_data(cell_slice: Slice) -> bytes:
    cell_slice.load_uint(32)
    cell_slice.load_uint(32)
    return cell_slice.load_bytes(32)


def load_wallet_v4_data(cell_slice: Slice) -> bytes:
    cell_slice.load_uint(32)
    cell_slice.load_uint(32)
    pubkey = cell_slice.load_bytes(32)
    cell_slice.load_maybe_ref()
    return pubkey


def load_wallet_v5_beta_data(cell_slice: Slice) -> bytes:
    cell_slice.load_bool()
    cell_slice.load_uint(32)
    cell_slice.load_uint(80)
    pubkey = cell_slice.load_bytes(32)
    cell_slice.load_maybe_ref()
    return pubkey


def load_wallet_v5_data(cell_slice: Slice) -> bytes:
    cell_slice.load_bool()
    cell_slice.load_uint(32)
    cell_slice.load_uint(32)
    pubkey = cell_slice.load_bytes(32)
    cell_slice.load_maybe_ref()
    return pubkey


